import React, { FC, Suspense, lazy } from 'react'
import styles from './button.module.css'
import { Link, Route } from 'react-router-dom'

const PopupTweet = lazy(() => import('../../../PopupTweet/PopupTweet')) // вопросики

type props = {
  SetPostNews: any
}

export const Button: FC<props> = ({ SetPostNews }) => {
  return (
    <>
      <Link to="/popup" className={styles.btnFont}>
        Tweet
      </Link>
      <Suspense fallback={<div>Loading...</div>}>
        <Route path="/popup" component={() => <PopupTweet SetPostNews={SetPostNews} />} />
      </Suspense>
    </>
  )
}
